let box = document.querySelector(".box");

function get(a) {
  a.forEach((el) => {
    let container = document.createElement("div");
    container.classList.add("container");
    container.style.backgroundColor = `${el.color}`;
    let img = document.createElement("img");
    img.src = el.img;
    img.classList.add("img");
    let name = document.createElement("h1");
    name.innerHTML = el.name;
    name.classList.add("name");
    let email = document.createElement("h2");
    email.innerHTML = el.email;
    email.classList.add("email");
    let address = document.createElement("h3");
    address.innerHTML = el.address;
    address.classList.add("address");
    let message = document.createElement("h2");
    message.innerHTML = el.message;
    message.classList.add("message");
    let input = document.createElement("input");
    input.classList.add("input");
    input.type = "checkbox";5
    let button = document.createElement("button");
    button.classList.add("edit");
    button.innerHTML = `<svg data-slot="icon" fill="none" stroke-width="1.5" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg" aria-hidden="true">
    <path stroke-linecap="round" stroke-linejoin="round" d="m16.862 4.487 1.687-1.688a1.875 1.875 0 1 1 2.652 2.652L10.582 16.07a4.5 4.5 0 0 1-1.897 1.13L6 18l.8-2.685a4.5 4.5 0 0 1 1.13-1.897l8.932-8.931Zm0 0L19.5 7.125M18 14v4.75A2.25 2.25 0 0 1 15.75 21H5.25A2.25 2.25 0 0 1 3 18.75V8.25A2.25 2.25 0 0 1 5.25 6H10"></path>
  </svg>`;
    box.appendChild(container);
    container.append(img, name, email, address, message, input, button);
  });
}
